import React from 'react'

class GoodsInfo extends React.Component{
    render(){
        return(
        <li>{this.props.name} {this.props.thumbnail} {this.props.price}</li>
        )
    }
}

function Shop() {


    return (
        fetch('api/goods/')
        .then(response =>  response.json())
        .then(items => {
            console.log(items) 
            return items
        }).then(items =>{
            <div>
            <ul>
                {items.map((item,i) => {
                    return (<GoodsInfo name={item.name} price={item.price}/>)
                })}
            </ul>
        </div>
        })

    )
}

export default Shop
